import React from 'react';

const Skills = () => {
  const frontendSkills = [
    { name: 'HTML5', icon: 'fab fa-html5', color: 'text-orange-500' },
    { name: 'CSS3', icon: 'fab fa-css3-alt', color: 'text-blue-500' },
    { name: 'JavaScript', icon: 'fab fa-js', color: 'text-yellow-400' },
    { name: 'Tailwind', icon: 'fas fa-wind', color: 'text-cyan-400' },
    { name: 'React', icon: 'fab fa-react', color: 'text-cyan-400' }
  ];

  const backendSkills = [
    { name: 'Node.js', icon: 'fab fa-node', color: 'text-green-500' },
    { name: 'Express.js', icon: 'fas fa-server', color: 'text-gray-500' },
    { name: 'MongoDB', icon: 'fas fa-database', color: 'text-green-400' },
    { name: 'JWT', icon: 'fas fa-lock', color: 'text-pink-500' },
    { name: 'Firebase', icon: 'fas fa-fire', color: 'text-orange-400' }
  ];

  const tools = [
    { name: 'Git', icon: 'fab fa-git-alt', color: 'text-red-500' },
    { name: 'GitHub', icon: 'fab fa-github', color: 'text-gray-300' },
    { name: 'VS Code', icon: 'fas fa-code', color: 'text-blue-400' },
    { name: 'Postman', icon: 'fas fa-rocket', color: 'text-orange-500' },
    { name: 'Nodemon', icon: 'fas fa-terminal', color: 'text-white' },
    { name: 'Vercel', icon: 'fas fa-triangle-circle-square', color: 'text-white' },
    { name: 'Netlify', icon: 'fas fa-cloud', color: 'text-teal-400' },
    { name: 'Figma', icon: 'fab fa-figma', color: 'text-pink-500' }
  ];

  const SkillCard = ({ skill, size = 'large' }) => {
    const cardSize = size === 'large' ? 'w-32 h-32' : 'w-28 h-28';
    const iconSize = size === 'large' ? 'text-4xl' : 'text-3xl';
    const textSize = size === 'large' ? 'text-sm' : 'text-xs';
    
    return (
      <div className={`skill-card bg-white dark:bg-card-dark p-6 rounded-xl border border-gray-200 dark:border-white/10 ${cardSize} flex flex-col items-center justify-center transition-all duration-300 hover:scale-105 transform group cursor-pointer`}>
        <i className={`${skill.icon} ${iconSize} ${skill.color} mb-3 group-hover:scale-110 transition-transform`}></i>
        <span className={`font-bold ${textSize} text-center group-hover:text-primary transition-colors`}>
          {skill.name}
        </span>
      </div>
    );
  };

  return (
    <section className="py-20 bg-gradient-to-br from-gray-50 via-blue-50 to-purple-50 dark:from-[#0d0d14] dark:via-gray-900 dark:to-purple-900/20 px-4" id="skills">
      <div className="max-w-6xl mx-auto">
        <div className="text-center mb-16">
          <h2 className="text-4xl md:text-5xl font-display font-bold mb-4">
            <span className="text-primary neon-text">Skills</span> &{' '}
            <span className="text-secondary neon-text-pink">Technologies</span>
          </h2>
          <div className="h-1 w-32 bg-gradient-to-r from-primary to-secondary mx-auto rounded-full"></div>
          <p className="text-gray-500 text-lg mt-4 italic">
            Technologies & tools I use to craft modern web experiences
          </p>
        </div>

        {/* Frontend Skills */}
        <div className="mb-16">
          <div className="text-center mb-8">
            <h3 className="text-2xl font-display font-bold text-primary mb-2 flex items-center justify-center gap-3">
              <i className="fas fa-palette text-secondary"></i>
              Frontend Development
            </h3>
            <div className="h-0.5 w-16 bg-gradient-to-r from-primary to-secondary mx-auto rounded-full"></div>
          </div>
          <div className="flex flex-wrap justify-center gap-6">
            {frontendSkills.map((skill, index) => (
              <SkillCard key={index} skill={skill} />
            ))}
          </div>
        </div>

        {/* Backend Skills */}
        <div className="mb-16">
          <div className="text-center mb-8">
            <h3 className="text-2xl font-display font-bold text-primary mb-2 flex items-center justify-center gap-3">
              <i className="fas fa-server text-secondary"></i>
              Backend Development
            </h3>
            <div className="h-0.5 w-16 bg-gradient-to-r from-primary to-secondary mx-auto rounded-full"></div>
          </div>
          <div className="flex flex-wrap justify-center gap-6">
            {backendSkills.map((skill, index) => (
              <SkillCard key={index} skill={skill} />
            ))}
          </div>
        </div>

        {/* Tools */}
        <div>
          <div className="text-center mb-8">
            <h3 className="text-2xl font-display font-bold text-primary mb-2 flex items-center justify-center gap-3">
              <i className="fas fa-tools text-secondary"></i>
              Tools & Platforms
            </h3>
            <div className="h-0.5 w-16 bg-gradient-to-r from-primary to-secondary mx-auto rounded-full"></div>
          </div>
          <div className="flex flex-wrap justify-center gap-6">
            {tools.map((tool, index) => (
              <SkillCard key={index} skill={tool} size="small" />
            ))}
          </div>
        </div>

        {/* Skill Progress Bars */}
        <div className="mt-16 bg-white/80 dark:bg-card-dark/80 backdrop-blur-sm p-8 rounded-2xl border border-gray-200 dark:border-white/10 shadow-lg">
          <h3 className="text-xl font-display font-bold text-center mb-8 text-primary">
            Proficiency Levels
          </h3>
          <div className="grid md:grid-cols-2 gap-6">
            {[
              { skill: 'Frontend Development', level: 85 },
              { skill: 'Backend Development', level: 75 },
              { skill: 'Database Management', level: 70 },
              { skill: 'Version Control', level: 80 }
            ].map((item, index) => (
              <div key={index} className="space-y-2">
                <div className="flex justify-between items-center">
                  <span className="font-medium text-gray-700 dark:text-gray-300">{item.skill}</span>
                  <span className="text-primary font-bold">{item.level}%</span>
                </div>
                <div className="w-full bg-gray-200 dark:bg-gray-700 rounded-full h-3 overflow-hidden">
                  <div 
                    className="h-full bg-gradient-to-r from-primary to-secondary rounded-full transition-all duration-1000 ease-out"
                    style={{ width: `${item.level}%` }}
                  ></div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
